// src/components/personalcare/PersonalCare.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './PersonalCare.css';

const categories = [
  'Skin Care',
  'Hair Care',
  'Baby and Mom Care',
  'Oral Care',
  'Elderly Care',
];

const PersonalCare = () => {
  const navigate = useNavigate();

  const handleCategoryClick = (cat) => {
    if (cat === 'Skin Care') {
      navigate('/personal-care/skin');
    } else if (cat === 'Hair Care') {
      navigate('/personal-care/hair');
    } else if (cat === 'Baby and Mom Care') {
      navigate('/personal-care/baby-mom');
    } else if (cat === 'Oral Care') {
      navigate('/personal-care/oral');
    } else if (cat === 'Elderly Care') {
      navigate('/personal-care/elderly');
    }
  };

  return (
    <div className="personal-care-container container py-4">
      <h2 className="text-center mb-4">ðŸ§¼ Personal Care</h2>

      {/* Category Buttons */}
      <div className="d-flex flex-wrap justify-content-center mb-4">
        {categories.map((cat) => (
          <button
            key={cat}
            className="btn btn-outline-primary m-2"
            onClick={() => handleCategoryClick(cat)}
          >
            {cat}
          </button>
        ))}
      </div>
    </div>
  );
};

export default PersonalCare;
